    <Button styles="login-btn" children="Login"/>
        <button className="add-to-cart flex justify-center align-center">
        <Image source={cart_img} alternate="cart image" styles = ""/>
     My Cart
  </button>
  </div>
    </div>

 </header>
  )
}
